static unsigned char l_capturing(unsigned int len) {
    int bottom = 0, top = 170;
    unsigned char idx = 85;

    while (1) {
        if (idx == 0) return idx;
        if (len <= topval[idx] && len > topval[idx - 1]) return idx;
        if (len < topval[idx])
            top = idx - 1;
        else
            bottom = idx + 1;
        idx = (bottom + top) / 2;
    }
}

static int mod_diff(unsigned int x, unsigned int y, unsigned int R) {
    int dl = 0;
    int dr = 0;
    if (y > x) {
        dl = (int)(y - x);
        dr = (int)(x + R - y);
    } else {
        dl = (int)(x - y);
        dr = (int)(y + R - x);
    }
    return (dl > dr ? dr : dl);
}

static int h_distance(int len, const unsigned char x[], const unsigned char y[]) {
    int diff = 0;
    for (int i = 0; i < len; i++) diff += bit_pairs_diff_table[x[i]][y[i]];
    return diff;
}

static unsigned char swap_byte(const unsigned char in) {
    unsigned char byte = 0;
    byte = ((in & 0xF0) >> 4) & 0x0F;
    byte |= ((in & 0x0F) << 4) & 0xF0;
    return byte;
}

static void to_hex(unsigned char * psrc, int len, char * pdest) {
    unsigned short * pwHex = (unsigned short *)HexLookup;
    unsigned short * pwDest = (unsigned short *)pdest;
    for (int i = 0; i < len; i++) *pwDest++ = pwHex[*psrc++];
    *((unsigned char *)pwDest) = 0;
}

static void from_hex(const char * psrc, int len, unsigned char * pdest) {
    for (int i = 0; i < len; i += 2) {
        unsigned d = DecLookup[*(unsigned char *)(psrc + i)] << 4;
        d |= DecLookup[*(unsigned char *)(psrc + i + 1)];
        *pdest++ = d;
    }
}

