struct lsh_bin_struct {
    unsigned char checksum[TLSH_CHECKSUM_LEN];
    unsigned char Lvalue;
    union {
        unsigned char QB;
        struct {
            unsigned char Q1ratio : 4;
            unsigned char Q2ratio : 4;
        } QR;
    } Q;
    unsigned char tmp_code[CODE_SIZE];
};

struct tlsh_state {
    unsigned int * a_bucket;
    unsigned char slide_window[SLIDING_WND_SIZE];
    unsigned int data_len;

    struct lsh_bin_struct lsh_bin;

    char * lsh_code;
    bool lsh_code_valid;
};

struct tlsh_state * tlsh_alloc() {
    struct tlsh_state * state = malloc(sizeof(struct tlsh_state));
    memset(state, 0, sizeof(struct tlsh_state));
}

void tlsh_free(struct tlsh_state * state) {
    free(state->a_bucket);
    free(state->lsh_code);
    free(state);
}

void tlsh_reset(struct tlsh_state * state) {
    free(state->a_bucket);
    state->a_bucket = NULL;
    memset(state->slide_window, 0, sizeof(state->slide_window));
    free(state->lsh_code);
    state->lsh_code = NULL;
    memset(&state->lsh_bin, 0, sizeof(state->lsh_bin));
    state->data_len = 0;
    state->lsh_code_valid = false;
}

